import './App.css';
import {BrowserRouter, Routes, Route, Link} from 'react-router-dom';
import Base from './components/base';

const App = () => {

  const openIOH = (e) => {
      e.preventDefault();
      window.location.href('https://in-our-hands.com/');
  }

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Base />}>
         <Route path="function" element={<Button />}/>
        </Route>
      </Routes>
    </BrowserRouter>
  )
}

export default App;
